import {
  SlProgressRing
} from "./chunk.TNNZI4CS.js";

// src/react/progress-ring/index.ts
import * as React from "react";
import { createComponent } from "@lit/react";
var tagName = "sl-progress-ring";
SlProgressRing.define("sl-progress-ring");
var reactWrapper = createComponent({
  tagName,
  elementClass: SlProgressRing,
  react: React,
  events: {},
  displayName: "SlProgressRing"
});
var progress_ring_default = reactWrapper;

export {
  progress_ring_default
};
